import ProductListing from '../../components/ProductListing/ProductListing.js';
import './HomePage.css';

function HomePage() {

  return (
    <>
        <div className='homepage'>
          <div className='homepage-listing-wrapper'>


          <div className='homepage-listings'>
            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />

            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />

            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />

            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />

            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />

            <ProductListing 
              product={{
                name:'Mac book air pro',
                price:99.99,
                yearOfProduction:'2022',
                color:'RED',
                condition: 'new'
              }}
            />
          </div>
          </div>
        </div>
    </>
  );
}

export default HomePage;
